package org.com.allen.enhance.basic.desginpattern.prototype;import java.util.List;public class UserMode {    private String name;    private Double salary;    private List<String> lists;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Double getSalary() {        return salary;    }    public void setSalary(Double salary) {        this.salary = salary;    }    public void setLists(List<String> lists) {        this.lists = lists;    }    public List<String> getLists() {        return lists;    }}